import { NavLink } from "react-router-dom";

const NavBar = () => {

    return (
        <nav className="navbar navbar-dark bg-primary mb-3">
            <div className="container">
                <a className="navbar-brand" href="/">WikiCountries</a>
            </div>
        </nav>
    )

}

export default NavBar
